# find the element that forms the majority in the array. 

# @param {Integer[]} nums
# @return {Integer}
def majority_element(nums)
  unique_nums = nums.uniq
  if nums.length == 1
    return nums[0]
  else
    number_to_beat = nums.length / 2
    for n in unique_nums
      return n if nums.count(n) > number_to_beat
    end
  end
end
